import React, { useState, useEffect } from 'react';
import {
  Container,
  Grid,
  Card,
  CardContent,
  Typography,
  Box,
  CircularProgress,
  Alert,
  Button,
} from '@mui/material';
import {
  Book,
  History,
  TrendingUp,
  Add,
} from '@mui/icons-material';
import { useNavigate } from 'react-router-dom';
import { historyAPI, booksAPI } from '../../services/api';
import { useAuth } from '../../contexts/AuthContext';

const Dashboard = () => {
  const [stats, setStats] = useState(null);
  const [recentBooks, setRecentBooks] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const { user } = useAuth();
  const navigate = useNavigate();

  useEffect(() => {
    fetchDashboardData();
  }, []);

  const fetchDashboardData = async () => {
    try {
      setLoading(true);
      const [statsResponse, booksResponse] = await Promise.all([
        historyAPI.getStats(),
        booksAPI.getBooks({ limit: 6, sort: 'updated_at' })
      ]);

      setStats(statsResponse.data.stats);
      setRecentBooks(booksResponse.data.books);
    } catch (err) {
      setError('Failed to load dashboard data');
      console.error('Dashboard error:', err);
    } finally {
      setLoading(false);
    }
  };

  const StatCard = ({ title, value, icon, color = 'primary', subtext = null }) => (
    <Card>
      <CardContent>
        <Box display="flex" alignItems="center" justifyContent="space-between">
          <Box>
            <Typography color="textSecondary" gutterBottom variant="body2">
              {title}
            </Typography>
            <Typography variant="h4" component="div">
              {value}
            </Typography>
            {subtext && (
              <Typography variant="caption" color="textSecondary">
                {subtext}
              </Typography>
            )}
          </Box>
          <Box color={`${color}.main`}>
            {icon}
          </Box>
        </Box>
      </CardContent>
    </Card>
  );

  const ProgressBar = ({ value, color = 'primary' }) => (
    <Box sx={{ width: '100%', bgcolor: 'grey.200', borderRadius: 1, overflow: 'hidden' }}>
      <Box 
        sx={{
          width: `${Math.min(100, Math.max(0, value))}%`,
          bgcolor: `${color}.main`,
          height: 8,
          transition: 'width 0.5s ease-in-out'
        }}
      />
    </Box>
  );

  if (loading) {
    return (
      <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
        <Box display="flex" justifyContent="center" alignItems="center" minHeight="400px">
          <CircularProgress />
        </Box>
      </Container>
    );
  }

  return (
    <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
      <Typography variant="h4" gutterBottom>
        Welcome back, {user?.full_name || user?.username}!
      </Typography>

      {error && (
        <Alert severity="error" sx={{ mb: 3 }}>
          {error}
        </Alert>
      )}

      {/* Statistics Cards */}
      <Grid container spacing={3} sx={{ mb: 4 }}>
        <Grid item xs={12} sm={6} md={3}>
          <StatCard
            title="Books Started"
            value={stats?.total_books_started || 0}
            subtext={`${stats?.books_in_progress || 0} in progress`}
            icon={<Book fontSize="large" />}
            color="primary"
          />
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <StatCard
            title="Books Completed"
            value={stats?.books_completed || 0}
            subtext={`${stats?.completion_rate || 0}% completion rate`}
            icon={<TrendingUp fontSize="large" />}
            color="success"
          />
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <StatCard
            title="Pages Read"
            value={stats?.total_pages_read || 0}
            subtext={`${stats?.total_pages_in_progress_books || 0} in progress`}
            icon={<History fontSize="large" />}
            color="info"
          />
        </Grid>
        <Grid item xs={12} sm={6} md={3}>
          <StatCard
            title="Average Progress"
            value={`${Math.round(stats?.avg_progress || 0)}%`}
            subtext={`${Math.round(stats?.avg_pages_per_book || 0)} avg pages/book`}
            icon={<TrendingUp fontSize="large" />}
            color="warning"
          />
        </Grid>
      </Grid>

      {/* Progress Overview */}
      <Card sx={{ mb: 4, p: 3 }}>
        <Typography variant="h6" gutterBottom>Reading Progress Overview</Typography>
        <Grid container spacing={3}>
          <Grid item xs={12} md={6}>
            <Box mb={2}>
              <Box display="flex" justifyContent="space-between" mb={1}>
                <Typography variant="body2" color="textSecondary">Completion Rate</Typography>
                <Typography variant="body2">{stats?.completion_rate || 0}%</Typography>
              </Box>
              <ProgressBar 
                value={stats?.completion_rate || 0} 
                color={stats?.completion_rate >= 50 ? 'success' : 'warning'}
              />
            </Box>
            <Box mb={2}>
              <Box display="flex" justifyContent="space-between" mb={1}>
                <Typography variant="body2" color="textSecondary">Books in Progress</Typography>
                <Typography variant="body2">{stats?.books_in_progress || 0} books</Typography>
              </Box>
              <ProgressBar 
                value={Math.min(100, (stats?.books_in_progress || 0) * 20)} 
                color="info"
              />
            </Box>
          </Grid>
          <Grid item xs={12} md={6}>
            <Box mb={2}>
              <Box display="flex" justifyContent="space-between" mb={1}>
                <Typography variant="body2" color="textSecondary">Average Book Progress</Typography>
                <Typography variant="body2">{Math.round(stats?.avg_progress || 0)}%</Typography>
              </Box>
              <ProgressBar 
                value={stats?.avg_progress || 0} 
                color={stats?.avg_progress >= 50 ? 'success' : 'warning'}
              />
            </Box>
            <Box>
              <Box display="flex" justifyContent="space-between" mb={1}>
                <Typography variant="body2" color="textSecondary">Total Pages Read</Typography>
                <Typography variant="body2">{stats?.total_pages_read || 0} pages</Typography>
              </Box>
              <ProgressBar 
                value={Math.min(100, (stats?.total_pages_read || 0) / 1000 * 100)} 
                color="primary"
              />
              <Typography variant="caption" color="textSecondary">
                {Math.round((stats?.total_pages_read || 0) / 1000 * 100)}% of 1000 pages goal
              </Typography>
            </Box>
          </Grid>
        </Grid>
      </Card>

      {/* Recent Books */}
      <Box sx={{ mb: 3 }}>
        <Box display="flex" justifyContent="space-between" alignItems="center" mb={2}>
          <Typography variant="h5" gutterBottom>
            Recent Books
          </Typography>
          <Button
            variant="contained"
            startIcon={<Add />}
            onClick={() => navigate('/add-book')}
          >
            Add Book
          </Button>
        </Box>

        {recentBooks.length === 0 ? (
          <Card>
            <CardContent>
              <Typography variant="body1" color="textSecondary" textAlign="center">
                No books available. Start by adding your first book!
              </Typography>
              <Box textAlign="center" mt={2}>
                <Button
                  variant="contained"
                  startIcon={<Add />}
                  onClick={() => navigate('/add-book')}
                >
                  Add Your First Book
                </Button>
              </Box>
            </CardContent>
          </Card>
        ) : (
          <Grid container spacing={3}>
            {recentBooks.map((book) => (
              <Grid item xs={12} sm={6} md={4} key={book._id}>
                <Card 
                  sx={{ 
                    height: '100%', 
                    cursor: 'pointer',
                    '&:hover': { 
                      boxShadow: 6,
                      transform: 'translateY(-2px)',
                      transition: 'all 0.3s ease-in-out'
                    }
                  }}
                  onClick={() => navigate(`/books/${book._id}`)}
                >
                  <CardContent>
                    <Typography variant="h6" component="div" gutterBottom noWrap>
                      {book.title}
                    </Typography>
                    <Typography variant="body2" color="textSecondary" gutterBottom>
                      by {book.author}
                    </Typography>
                    <Typography variant="body2" color="textSecondary">
                      {book.description?.substring(0, 100)}
                      {book.description?.length > 100 ? '...' : ''}
                    </Typography>
                    <Box mt={2}>
                      <Typography variant="caption" color="textSecondary">
                        {book.genre && `Genre: ${book.genre}`}
                      </Typography>
                    </Box>
                  </CardContent>
                </Card>
              </Grid>
            ))}
          </Grid>
        )}
      </Box>

      {/* Quick Actions */}
      <Card>
        <CardContent>
          <Typography variant="h6" gutterBottom>
            Quick Actions
          </Typography>
          <Grid container spacing={2}>
            <Grid item xs={12} sm={6} md={3}>
              <Button
                fullWidth
                variant="outlined"
                startIcon={<Book />}
                onClick={() => navigate('/books')}
              >
                Browse Books
              </Button>
            </Grid>
            <Grid item xs={12} sm={6} md={3}>
              <Button
                fullWidth
                variant="outlined"
                startIcon={<Add />}
                onClick={() => navigate('/add-book')}
              >
                Add Book
              </Button>
            </Grid>
            <Grid item xs={12} sm={6} md={3}>
              <Button
                fullWidth
                variant="outlined"
                startIcon={<History />}
                onClick={() => navigate('/history')}
              >
                Reading History
              </Button>
            </Grid>
            <Grid item xs={12} sm={6} md={3}>
              <Button
                fullWidth
                variant="outlined"
                onClick={() => navigate('/profile')}
              >
                Profile Settings
              </Button>
            </Grid>
          </Grid>
        </CardContent>
      </Card>
    </Container>
  );
};

export default Dashboard;
